import React from "react";

const About = () => (
  <div className="content">
    <h2> About CampusFlow</h2>
    <p>
      CampusFlow is a simple student portal built using React and LocalStorage.
      It helps manage events, placements, and forum discussions within your campus.
    </p>
    <p>
      Developed by <strong>Student Developers</strong> under Vignan University.
    </p>
    <p>Version: <strong>2.0.0</strong></p>
  </div>
);

export default About;
